import React, { Component } from "react";

class Profile extends Component {
    constructor() {
      super();
      this.state = {
        userData: []
      }
  
    }
  
    getUserData(uData) {
      this.setState({userData : uData})
    }
  
    render() {
  
      return (
      <div>
        <Nav
          onGetUserData={this.getUserData.bind(this)} />
        <ProfileHeader />
        <PostsContainer
          routeParams={this.props.params}
          onGetUserData={this.getUserData.bind(this)} />
        <Footer />
      </div>
      )
    }
  }

